        <header>
            <div className="first-div">
                <img className="pic2" src="/images/gui.png"></img>
                <h1>Guilherme Moret</h1>
                <h3>Full Stack developer</h3>
            </div>
                <img className="mountain" src={dev} alt="Mountain"></img>
        </header>
    );
}

export default Header;
